	public String breakBigString(String i_str){
		String _res = "";
		while(i_str.length() > 150){
			//System.out.println("\n\nName\t" + _res);
			_res += i_str.substring(0,150) + "<br>";
			i_str = i_str.substring(150 , i_str.length());
		}

		if(i_str.length() <= 150){
			_res += i_str;
		}


		return _res ;
	}
	public String breakString(String i_str){
		String _res = "";
		while(i_str.length() > 50){
			//System.out.println("\n\nName\t" + _res);
			_res += i_str.substring(0,50) + "<br>";
			i_str = i_str.substring(50 , i_str.length());
		}

		if(i_str.length() <= 50){
			_res += i_str;
		}


		return _res ;
	}
	public String breakStringModified(String i_str , int i_length){
		String _res = "";
		while(i_str.length() > i_length){
			//System.out.println("\n\nName\t" + _res);
			_res += i_str.substring(0,i_length) + "<br>";
			i_str = i_str.substring(i_length , i_str.length());
		}

		if(i_str.length() <= i_length){
			_res += i_str;
		}


		return _res ;
	}

	public String formatString(String i_string) {
		String temp = i_string;
		if (temp == null)
			temp = "";
		else {
			temp = temp.trim();
			temp = temp.replaceAll("\n"," ");
			temp = temp.replaceAll("'","''");
			temp = temp.replaceAll("\r","");

			if(temp.contains("  ")){
				temp = temp.replaceAll("\\s\\s+"," ");
			}

			temp=toISO(temp);

		}
		return temp;
	}

	public String formatStringForDisplay(String i_string){

		String temp = i_string;
		if (i_string == null)
			temp = "";
		else {
			//temp = i_string.replaceAll("'","\\'").replaceAll("\"","\\&quot;");
			temp = i_string.replaceAll("\"","\\&quot;");
			temp = temp.replaceAll("'","\\\\\'");
			temp = temp.replaceAll("\"","\\\\\"");
		}


		return temp;

	}

	public String getDatadisplay(Vector i_vector){

		String _dataList = "";
		for (Enumeration enum_vector = i_vector.elements(); enum_vector.hasMoreElements(); ){
			String _data = (String)enum_vector.nextElement();
			if (_dataList.equals(""))
				_dataList +=  _data ;
			else
				_dataList += "," + _data ;
		}
		return _dataList;
}


public String getDataArrayList(List<String> list){

		String _dataList = "";

		for(String _data : list){
			if (_dataList.equals(""))
				_dataList += "'" + _data +"'";
			else
				_dataList += ",'" + _data +"'";
		}

		return _dataList;
}

	public String getDataList(Vector i_vector){

			String _dataList = "";
			for (Enumeration enum_vector = i_vector.elements(); enum_vector.hasMoreElements(); ){
				String _data = (String)enum_vector.nextElement();
				if (_dataList.equals(""))
					_dataList += "'" + _data +"'";
				else
					_dataList += ",'" + _data +"'";
			}
			return _dataList;
	}
	public String getFormattedStructure(String i_struct){

		String struct = "";
		if(i_struct != null || !i_struct.equals("")){
			struct = i_struct.trim();
			struct = "\n  " + struct;
		}

		return struct;
	}

	// PROVIDE COMMA SEPERATED STING AND IT WILL RETURN QUERYSTRING
	public String getQuerySting(String i_pmidlist){
		if(i_pmidlist.contains(",")){
			i_pmidlist = i_pmidlist.replaceAll(",","','");
		}
		i_pmidlist = "'" + i_pmidlist + "'";
		return i_pmidlist;
	}


	public String setHighLighter(String parent_string,String search_str){
		search_str = search_str.replaceAll("%","");
		StringBuffer str_buff = new StringBuffer();
		boolean found=false;
		String[] tmp_sen = parent_string.split("\\.");

		for(int k = 0 ; k < tmp_sen.length ; k++){
		 try{

			Pattern pattern = Pattern.compile("("+search_str+")", Pattern.CASE_INSENSITIVE);
			String _ori="";
			Matcher matcher = pattern.matcher(tmp_sen[k]);
			found=false;
			if(matcher.find()) {
				_ori=matcher.group(0) ;
				str_buff.append(tmp_sen[k].replaceAll(_ori,"<span  style=\"background: #CCFFCC;font-size: 14;font-weight: bold;\">"+_ori+"</span>"));
				//str_buff.append(tmp_sen[k]);
				 found=true;
			}

		}catch(Exception e){
		//	System.out.println(str_buff.toString()+e+"--");
			str_buff=new StringBuffer();
			str_buff.append(parent_string);
		}
	}

		return str_buff.toString();

	}

